import React from "react";
class ADD extends React.Component{
    render(){
        const{number1,number2}=this.props
        return(
            <div>
                {number1}+{number2}={number1+number2}
            </div>
        );
    }
    
}
ADD.default={
    number1:10,
    number2:20
}
export default Add;
